import React from 'react';
import { Box, Container, Toolbar, Typography } from '@mui/material';
const Movies = () => {
  return (
    <>
      <Toolbar></Toolbar>

      <Container
        sx={{ background: 'black', height: '100vh', color: 'white', pt: 5 }}>
        <Box>
          <Typography>Movies </Typography>
        </Box>
      </Container>
      <Toolbar></Toolbar>
    </>
  );
};

export default Movies;
